import React, { useState } from 'react'
import { Link } from 'react-router-dom'

//antd

const Signup = () => {
    const [input, setInput] = useState({
        username: '',
        password: '',
        confirmPassword: '',
    })

    const [error, setError] = useState({
        username: '',
        password: '',
        confirmPassword: '',
    })

    const [showpsd, setShowpsd] = useState('password')

    const myFunction = (e) => {
        if (e.target.checked === true) {
            setShowpsd('text')
        } else {
            setShowpsd('password')
        }
    }

    const inputChange = (e) => {
        const { name, value } = e.target
        setInput((prev) => ({
            ...prev,
            [name]: value,
        }))
        validateInput(e)
    }

    const validateInput = (e) => {
        let { name, value } = e.target
        setError((prev) => {
            const stateObj = { ...prev, [name]: '' }

            switch (name) {
                case 'username':
                    if (!value) {
                        stateObj[name] = 'Please Enter Username.'
                    }
                    break
                case 'password':
                    if (!value) {
                        stateObj[name] = 'Please Enter Password.'
                    } else if (input.confirmPassword && value !== input.password) {
                        stateObj['confirmPassword'] = 'Password and Confirm Password does not match.'
                    } else {
                        stateObj['confirmPassword'] = input.confirmPassword ? '' : error.confirmPassword
                    }
                default:
                    break
            }
        })
    }

    return (
        <>
            <form className='form'>
                <fieldset style={{ border: '2px black solid', padding: '10px', width: '600px' }}>
                    <h2
                        style={{
                            textAlign: 'center',
                            fontSize: '40px',
                            color: 'black',
                        }}
                    >
                        <u>
                            <b> Sign Up </b>
                        </u>
                    </h2>
                    <p>
                        <label>Username:</label>
                        <input
                            type='text'
                            id='uname'
                            autoComplete='off'
                            placeholder='Please Enter Username.'
                            value={input.username}
                            onChange={inputChange}
                            onBlur={validateInput}
                            name='username'
                        />
                        {error.username && <span className='err'>{error.username}</span>}
                    </p>
                    <p>
                        <label>Password:</label>
                        <input
                            type={showpsd}
                            className='psd'
                            value={input.password}
                            autoComplete='off'
                            placeholder='Please enter password'
                            onkeyup='passCheck(this.value)'
                            onChange={inputChange}
                            onBlur={validateInput}
                            name='password'
                        />
                        {error.password && <span className='err'>{error.password}</span>}
                    </p>
                    <p>
                        <label>Confirm Password:</label>
                        <input
                            type={showpsd}
                            value={input.confirmPassword}
                            className='psd'
                            autocomplete='off'
                            placeholder='Please confirm your password'
                            onChange={inputChange}
                            onBlur={validateInput}
                            name='confirmPassword'
                        />
                        {error.confirmPassword && <span className='err'>{error.confirmPassword}</span>}
                        <input type='checkbox' onChange={myFunction} />
                        &nbsp; Show Password
                        <div>
                            <label className='password_check'>1 UPPERCASE Charachter</label>
                            <label className='password_check'>1 Special Charachter</label>
                            <label className='password_check'>1 Numerical Charachter</label>
                            Don't want to create account? Explore our&nbsp;
                            <Link to='./' style={{ textDecoration: 'none', color: 'orange' }}>
                                Home
                            </Link>
                            <br />
                            Already have an account?&nbsp;
                            <Link to='./login' style={{ textDecoration: 'none', color: 'green' }}>
                                Login
                            </Link>
                        </div>
                    </p>
                    <button type='submit' id='submit'>
                        Sign Up
                    </button>
                    <button type='reset' id='reset'>
                        Reset
                    </button>
                </fieldset>
            </form>
